geregisseerd door Peter Hewitt
met Ryan Ochoa, Bella Thorne en Madison Pettis

Max is een typische 11-jarige: hij houdt van magie, sport en is verliefd op Traci, 
het meest geliefde meisje van de hele school. 
Maar hij is de enige die de spoken kan zien rondspoken in zijn huis. 
Twee jonge geesten maken met hem de deal van zijn leven: hij kan hun helpen 
een oplossing te vinden voor het mysterie van de verdwijning van hun ouders. 
Max krijgt hiervoor terug dat hij onzichtbaar mag worden, 
om zo in de buurt van Traci te komen.

Bella Thorne (Shake It Up!, Frienenemies), Madison Pettis (Lab Rats, 
Beverly Hills Chihuahua 3) and Ryan Ochoa (Pair of Kings, The Perfect Game) 
lead an ensemble cast in this spook-tacular ... 



